// https://leetcode.com/problems/number-of-islands/
class Solution {
public:
    void travese(vector<vector<char>>& grid, int r, int c){
        int dx[] = {0, 0, 1, -1};
        int dy[] = {1, -1, 0, 0};

        queue<pair<int, int>> q;
        q.push({r, c});

        while(!q.empty()){
            r = q.front().first;
            c = q.front().second;
            q.pop();
            for(int i=0; i<4; i++){
                int x = r+dx[i];
                int y = c+dy[i];

                if(x >= 0 && y >= 0 && x < grid.size() && y < grid[0].size() && grid[x][y] == '1'){
                    grid[x][y] = '0';
                    q.push({x,y});
                }
            }
        }
    }
    int numIslands(vector<vector<char>>& grid) {
        int count = 0;
        for(int r=0; r<grid.size(); r++){
            for(int c=0; c<grid[0].size(); c++){
                if(grid[r][c] == '1'){
                    count++;
                    grid[r][c] = '0';
                    travese(grid, r, c);
                }
            }
        }

        return count;
    }
};
